import React from "react";
import "../PostShare/PostShare.css";
import ProfilePicture from "../../../img/profileImg.jpg";

const PostShare = () => {
  return (
    <div className="PostShare">
      <img src={ProfilePicture} alt="" />
    </div>
  );
};

export default PostShare;
